import Home from "@/views/Home";
import Router from "@vue/cli-plugin-router/generator/template/src/router";

export default new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes: [
        {
            path: "/",
            name: "Home",
            component: Home,
        }
    ],
});
